function getNodeIconListIcon(name: string, extendIconList = []): string | undefined {
    let arr = name.split('_')
    let typeData = [...nodeIconList, ...extendIconList].find(item => {
        return item.type === arr[0]
    })
    if (!typeData) {
        return;
    }
    let item = typeData.list.find(item => {
        return item.name === arr[1]
    });
    if (!item) {
        return;
    }
    return item.icon
}



export default {
    hyperlink,
    note,
    nodeIconList,
    getNodeIconListIcon
}
